package com.company.dao.pojo;

import java.util.Date;

public class Dept {
	
	private int deptno;
	private String dname;
	private String deptLocation;
	private Date createTime;
	private Date updateTime;
	
	public Dept() {
		// TODO Auto-generated constructor stub
	}

	public Dept(int deptno, String dname, String deptLocation, Date createTime, Date updateTime) {
		super();
		this.deptno = deptno;
		this.dname = dname;
		this.deptLocation = deptLocation;
		this.createTime = createTime;
		this.updateTime = updateTime;
	}

	public Dept(String dname, String deptLocation, Date createTime, Date updateTime) {
		super();
		this.dname = dname;
		this.deptLocation = deptLocation;
		this.createTime = createTime;
		this.updateTime = updateTime;
	}

	public int getDeptno() {
		return deptno;
	}

	public void setDeptno(int deptno) {
		this.deptno = deptno;
	}

	public String getDname() {
		return dname;
	}

	public void setDname(String dname) {
		this.dname = dname;
	}

	public String getDeptLocation() {
		return deptLocation;
	}

	public void setDeptLocation(String deptLocation) {
		this.deptLocation = deptLocation;
	}

	public Date getCreateTime() {
		return createTime;
	}

	public void setCreateTime(Date createTime) {
		this.createTime = createTime;
	}

	public Date getUpdateTime() {
		return updateTime;
	}

	public void setUpdateTime(Date updateTime) {
		this.updateTime = updateTime;
	}

	@Override
	public String toString() {
		return "Dept [deptno=" + deptno + ", dname=" + dname + ", deptLocation=" + deptLocation + ", createTime="
				+ createTime + ", updateTime=" + updateTime + "]";
	}
	
	

}
